import './App.css';
import NavbarComp from './NavbarComp';

function App() {
  return (
    <div className="App">
      <header>
        <p>Header</p>
      </header>
      <body>
        <p>vor NavbarComp</p>
        <NavbarComp />
        <p>nach NavbarComp</p>
      </body>
    </div>
  );
}

export default App;
